":"http://bit.ly/Subscribe-to-Screenrant","navigationEndpoint":{"clickTrackingParams":"CJ4BEM2rARgBIhMIqMK9tp-a6gIVfxrxBR3zHw2ESN3Ik7WZiNT0KQ==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fbit.ly%2FSubscribe-to-Screenrant\u0026v=KelQQZak5F0\u0026event=video_description\u0026redir_token=uI8kKzPRoOX9u65PyBAFro8AI2R8MTU5MzA4MTAyNkAxNTkyOTk0NjI2","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A%2F%2Fbit.ly%2FSubscribe-to-Screenrant\u0026v=KelQQZak5F0\u0026event=video_description\u0026redir_token=uI8kKzPRoOX9u65PyBAFro8AI2R8MTU5MzA4MTAyNkAxNTkyOTk0NjI2","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nFew shows have been as obsessively combed over as Breaking Bad. Reaching the height of its cultural ubiquity during its final season in 2015, it sometimes feels like every frame of the show has been picked apart and dissected by superfans. Surprisingly, it seems that Breaking Bad is the rare show that can stand up to this kind of scrutiny, and fans are still discovering easter eggs, references, and complex foreshadowing over the course of the show’s 62 episodes.  \n\nWith the upcoming sequel film El Camino on the horizon, we thought now would be a good time to take a look back at the series as a whole, and pick out some of the most interesting details you may have missed. From blink-and-you’ll-miss-it-jokes to thought provoking thematic mirroring, we’ve got you covered. \n\nA prop that connects the very end of the show to the very beginning. The dramatic foreshadowing for one of TV’s greatest deaths. The costuming choice that told us more about Breaking Bad’s characters. A payoff to a breakfast question many seasons in the making. A background detail that set up a major character. The set decoration that alludes to the shows opening credits. The creepy set up to one of Walt’s worst deeds. The subtle references to a departed character. The idea that hatched Gus’ most devious move. A clever cameo by series creator Vince Gilligan.\n\nOur Social Media:\n"},{"text":"https://twitter.com/screenrant","navigationEndpoint":{"clickTrackingParams":"CJ4BEM2rARgBIhMIqMK9tp-a6gIVfxrxBR3zHw2ESN3Ik7WZiNT0KQ==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Ftwitter.com%2Fscreenrant\u0026v=KelQQZak5F0\u0026event=video_description\u0026redir_token=uI8kKzPRoOX9u65PyBAFro8AI2R8MTU5MzA4MTAyNkAxNTkyOTk0NjI2","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Ftwitter.com%2Fscreenrant\u0026v=KelQQZak5F0\u0026event=video_description\u0026redir_token=uI8kKzPRoOX9u65PyBAFro8AI2R8MTU5MzA4MTAyNkAxNTkyOTk0NjI2","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n"},{"text":"https://www.facebook.com/ScreenRant","navigationEndpoint":{"clickTrackingParams":"CJ4BEM2rARgBIhMIqMK9tp-a6gIVfxrxBR3zHw2ESN3Ik7WZiNT0KQ==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Fwww.facebook.com%2FScreenRant\u0026v=KelQQZak5F0\u0026event=video_description\u0026redir_token=uI8kKzPRoOX9u65PyBAFro8AI2R8MTU5MzA4MTAyNkAxNTkyOTk0NjI2","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Fwww.facebook.com%2FScreenRant\u0026v=KelQQZak5F0\u0026event=video_description\u0026redir_token=uI8kKzPRoOX9u65PyBAFro8AI2R8MTU5MzA4MTAyNkAxNTkyOTk0NjI2","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nOur Website\n"},{"text":"http://screenrant.com/","navigationEndpoint":{"clickTrackingParams":"CJ4BEM2rARgBIhMIqMK9tp-a6gIVfxrxBR3zHw2ESN3Ik7WZiNT0KQ==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fscreenrant.com%2F\u0026v=KelQQZak5F0\u0026event=video_description\u0026redir_token=uI8kKzPRoOX9u65PyBAFro8AI2R8MTU5MzA4MTAyNkAxNTkyOTk0NjI2","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A%2F%2Fscreenrant.com%2F\u0026v=KelQQZak5F0\u0026event=video_description\u0026redir_token=uI8kKzPRoOX9u65PyBAFro8AI2R8MTU5MzA4MTAyNkAxNTkyOTk0NjI2","target":"TARGET_NEW_WINDOW","nofollow":true}}}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_D
